import React from "react";
import { Typography, Button, Container } from "@mui/material";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <Container
      sx={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
        textAlign: "center",
      }}
    >
      <Typography variant="h3" sx={{ marginBottom: "2rem" }}>
        Welcome to WattWise
      </Typography>
      <Typography variant="body1" sx={{ marginBottom: "2rem" }}>
        At WattWise, we're dedicated to helping you manage your energy
        consumption more efficiently. Our platform provides insightful data
        analytics and tools to optimize energy usage, reduce costs, and
        contribute to a more sustainable future.
      </Typography>
      <div sx={{ display: "flex", gap: "1rem" }}>
        <Button
          variant="contained"
          color="primary"
          component={Link}
          to="/dashboard"
        >
          Dashboard
        </Button>
        <Button
          variant="contained"
          color="secondary"
          component={Link}
          to="/login"
        >
          Login
        </Button>
      </div>
    </Container>
  );
};

export default Home;
